import { MDBContainer, MDBCard, MDBCardBody, MDBCardTitle, MDBCardText, MDBBtn, MDBIcon } from 'mdb-react-ui-kit';
import React from 'react';

export default function Story() {
  return (
    <MDBContainer className='mt-3 border py-4 d-flex justify-content-center'>
      <MDBCard style={{ maxWidth: '7rem' }} className='text-center '>
        <MDBBtn rounded style={{ maxWidth: '4rem', minHeight: '4rem' }}><MDBIcon fas icon="user-astronaut" /></MDBBtn>

        <MDBCardText className='text-nowrap' style={{ padding: 0, margin: 0 }}>
          Jon Smith
        </MDBCardText>
      </MDBCard>
    </MDBContainer>
  );
}
